import React from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarToggler, Collapse, MDBNavItem, MDBNavLink } from 'mdbreact';
import { BrowserRouter as Router, Route  } from 'react-router-dom';
// import routes from '../routes'
// import {CardPortfolio} from './Card'


export class NavbarFeatures extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            collapse: false,
            isWideEnough: false,
        };
    this.onClick = this.onClick.bind(this);
    }

    onClick(){
        this.setState({
            collapse: !this.state.collapse,
        });
    }

    render() {
        return (
            // <Router>
                <MDBNavbar color="black" dark expand="sm" sticky="top">
                    <MDBNavbarBrand href="/" >
                        <strong>Ryan Drachenberg</strong>
                    </MDBNavbarBrand>
                    { !this.state.isWideEnough && <MDBNavbarToggler onClick = { this.onClick } right />}
                    <Collapse isOpen = { this.state.collapse } MDBNavbar>
                        <MDBNavbar right>
                                <MDBNavItem active>
                                    <MDBNavLink className="MDBNav-link" to="/">About</MDBNavLink>
                                </MDBNavItem>
                                <MDBNavItem>
                                    <MDBNavLink className="MDBNav-link" to="/portfolio">Portfolio</MDBNavLink>
                                </MDBNavItem>
                                <MDBNavItem>
                                    <MDBNavLink className="MDBNav-link" to="/contact-me">Contact Me</MDBNavLink>
                                </MDBNavItem>
                                <MDBNavItem>
                                    <MDBNavLink className="MDBNav-link" to="/api-render">API</MDBNavLink>
                                </MDBNavItem>
                        </MDBNavbar>
                    </Collapse>
                </MDBNavbar>
            // </Router> 
        );
    }
}
